static void
docker_monitor_bpf__destroy(struct docker_monitor_bpf *obj)
{
	if (!obj)
		return;
	if (obj->skeleton)
		bpf_object__destroy_skeleton(obj->skeleton);
	free(obj);
}

static inline int
docker_monitor_bpf__create_skeleton(struct docker_monitor_bpf *obj);

static inline struct docker_monitor_bpf *
docker_monitor_bpf__open_opts(const struct bpf_object_open_opts *opts)
{
	struct docker_monitor_bpf *obj;

	obj = (struct docker_monitor_bpf *)calloc(1, sizeof(*obj));
	if (!obj)
		return NULL;
	if (docker_monitor_bpf__create_skeleton(obj))
		goto err;
	if (bpf_object__open_skeleton(obj->skeleton, opts))
		goto err;

	return obj;
err:
	docker_monitor_bpf__destroy(obj);
	return NULL;
}

static inline struct docker_monitor_bpf *
docker_monitor_bpf__open(void)
{
	return docker_monitor_bpf__open_opts(NULL);
}

static inline int
docker_monitor_bpf__load(struct docker_monitor_bpf *obj)
{
	return bpf_object__load_skeleton(obj->skeleton);
}

static inline struct docker_monitor_bpf *
docker_monitor_bpf__open_and_load(void)
{
	struct docker_monitor_bpf *obj;

	obj = docker_monitor_bpf__open();
	if (!obj)
		return NULL;
	if (docker_monitor_bpf__load(obj)) {
		docker_monitor_bpf__destroy(obj);
		return NULL;
	}
	return obj;
}

